postcontent:
Like new G23 Gen 4, approximately 175 rounds fired.  Comes with box, 5x 13-round magazines, backstraps, test-fire brass/envelope, and (non-factory) lock.  Does not have the cleaning rod/nylon brush, magazine loading tool, or manual.  Serial prefix is UPV, test-fire date of 2/8/13.  This one has the less-matte (more scratch-resistant) finish.  

I am not the original owner, but purchased the gun in essentially new condition, aside from the result of someone thinking about smoothing out the bottom of the trigger guard but then giving up rather quickly.  Basically, it's like the bottom of the trigger guard was run over a few times with some sandpaper so that it is relatively smooth.  A significant amount of material was not removed.  Aside from that, the gun is cosmetically in great condition. 

Completely stock except for steel 3-dot sights (not night sights).  The sights have been on multiple guns in the past, so they aren't that great looking.  But, I think they're better than the stock plastic sights.  

The gun also comes with a Don Hume H721OT right hand belt holster.  The holster is definitely used, but I no longer have use for it.

Also included is 345 rounds of factory new .40S&W ammunition, including:

139 rounds WWB FMJ;
50 rounds Remington JHP;
50 rounds PPU JHP;
and 106 rounds Winchester Ranger JHP.

For the gun, 5 mags, holster, and 345 rounds, the price is $520
